import React from 'react'
import Rightbar from "../Components/Rightbar";
import Topbar from "../Components/Topbar";
import Feed from "../Components/Feed";
import Leftbar from "../Components/Leftbar";

export default function Profile() {
  return (
    <div>
        <Topbar/>
        <div className="flex">
            <Leftbar/>
            <div className='flex-col'>
                <div>
                    <img src="/Assest/post/5.jpeg" alt="" className='relative h-[400px] w-full'/>
                    <img src="/Assest/person/5.jpeg" alt="" className='absolute top-0 h-20 w-20 rounded-full'/>
                </div>
                <div className=''>
                    <Feed/>
                    <Rightbar/>
                </div>
            </div>
        </div>
    </div>
  )
}
